import cv2
import pickle
import os
import sys
from sklearn.neighbors import NearestNeighbors
from Vectors import Vectorize
import logging
from scipy import spatial


class Similarity:

    def __init__(self):

        self.vect = Vectorize(modelname='model.h5')
        self.data_in_RAM = []
        logging.info('Finding similar images: Similarity class has been initialized.')

    def ind_similar(self, image, n_neighbors=5, test_mode=False, print_output=False):
        values = []
        vec_to_knn = [self.vect.img_to_vec(image)]

        output_dict = dict()
        vector2indx = dict()
        indx = 0
        counter = 0

        if len(self.data_in_RAM) < 1:
            raise Exception('No files in RAM. Please, execute a function to upload the database into RAM.')

        for doc in self.data_in_RAM:
            vector = doc[self.vect.str_vector]
            dist = spatial.distance.cosine(vec_to_knn, vector)
            vector2indx[indx] = vector
            output_dict[indx] = dist
            if len(output_dict) > n_neighbors:
                del output_dict[max(output_dict, key=output_dict.get)]
            indx += 1
            if test_mode:
                counter += 1
                if counter > 5000:
                    break

        output_dict = {k: output_dict[k] for k in sorted(output_dict, key=output_dict.get)}

        logging.info('Finding similar images: Distances between vectors computed.')

        for idx, distance in output_dict.items():
            docid = self.vect.vectors.find_one({self.vect.str_vector: vector2indx[idx]})[self.vect.str_id]
            # distance = dist[0][i]
            values.append({'DocId': str(docid), 'distance': str(distance)})

        if print_output:
            print(values)

        return values

    def upload_data_ram(self):
        self.data_in_RAM = []
        for doc in self.vect.vectors.find({}):
            self.data_in_RAM.append(doc)


if __name__ == '__main__':
    from Vectors import stringToRGB

    sim = Similarity()
    print('Starting to upload the data into RAM.')
    sim.upload_data_ram()
    print('Upload done.')

